    y[14] = c[14]*34.014740*CWinv; 
    y[15] = c[15]*18.015340*CWinv; 
    y[16] = c[16]*25.030270*CWinv; 
    y[17] = c[17]*41.029670*CWinv; 
    y[18] = c[18]*26.038240*CWinv; 
    y[19] = c[19]*27.046210*CWinv; 
    y[20] = c[20]*28.054180*CWinv; 
    y[21] = c[21]*29.062150*CWinv; 
    y[22] = c[22]*30.070120*CWinv; 
    y[23] = c[23]*31.034460*CWinv; 
    y[24] = c[24]*31.034460*CWinv; 
    y[25] = c[25]*42.037640*CWinv; 
    y[26] = c[26]*39.057360*CWinv; 
    y[27] = c[27]*38.049390*CWinv; 
