    y[29] = c[29]*42.037640*CWinv; 
    y[30] = c[30]*43.045610*CWinv; 
    y[31] = c[31]*43.045610*CWinv; 
    y[32] = c[32]*44.053580*CWinv; 
    y[33] = c[33]*46.069520*CWinv; 
    y[34] = c[34]*45.061550*CWinv; 
    y[35] = c[35]*45.061550*CWinv; 
