    /*reaction 191: c2h2 + oh <=> hccoh + h */
    qf[190] = sc[12]*sc[18];
    qr[190] = sc[1]*sc[25];

    /*reaction 192: c2h2 + oh <=> ch2co + h */
    qf[191] = sc[12]*sc[18];
    qr[191] = sc[1]*sc[29];

    /*reaction 193: c2h2 + oh <=> ch2co + h */
    qf[192] = sc[12]*sc[18];
    qr[192] = sc[1]*sc[29];

    /*reaction 194: c2h2 + oh <=> ch3 + co */
    qf[193] = sc[12]*sc[18];
    qr[193] = sc[3]*sc[9];

    /*reaction 195: hccoh + h <=> ch2co + h */
    qf[194] = sc[1]*sc[25];
    qr[194] = sc[1]*sc[29];

    /*reaction 196: c2h2 + o <=> ch2 + co */
    qf[195] = sc[11]*sc[18];
