    qr[207] = sc[10]*sc[32];

    /*reaction 209: ch2hco <=> ch3 + co */
    qf[208] = sc[30];
    qr[208] = sc[3]*sc[9];

    /*reaction 210: ch2hco <=> ch2co + h */
    qf[209] = sc[30];
    qr[209] = sc[1]*sc[29];

    /*reaction 211: ch2co + o <=> co2 + ch2 */
    qf[210] = sc[11]*sc[29];
    qr[210] = sc[4]*sc[8];

    /*reaction 212: ch2co + h <=> ch3 + co */
    qf[211] = sc[1]*sc[29];
    qr[211] = sc[3]*sc[9];

    /*reaction 213: ch2co + h <=> hcco + h2 */
    qf[212] = sc[1]*sc[29];
    qr[212] = sc[0]*sc[17];

    /*reaction 214: ch2co + o <=> hcco + oh */
    qf[213] = sc[11]*sc[29];
