    /*reaction 217: c2h + h2 <=> c2h2 + h */
    qf[216] = sc[0]*sc[16];
    qr[216] = sc[1]*sc[18];

    /*reaction 218: c2h + o <=> ch + co */
    qf[217] = sc[11]*sc[16];
    qr[217] = sc[5]*sc[9];

    /*reaction 219: c2h + oh <=> hcco + h */
    qf[218] = sc[12]*sc[16];
    qr[218] = sc[1]*sc[17];

    /*reaction 220: c2h + o2 <=> co + co + h */
    qf[219] = sc[10]*sc[16];
