    J[438] += 2 * dqdci;          /* dwdot[co]/d[o] */
    J[440] -= dqdci;              /* dwdot[o]/d[o] */
    J[446] -= dqdci;              /* dwdot[hcco]/d[o] */
    /* d()/d[hcco] */
    dqdci =  + k_f*sc[11];
    J[664] += dqdci;              /* dwdot[h]/d[hcco] */
