    /* d()/d[o] */
    dqdci =  + k_f*sc[17];
    J[434] += dqdci;              /* dwdot[ch]/d[o] */
    J[437] += dqdci;              /* dwdot[co2]/d[o] */
    J[440] -= dqdci;              /* dwdot[o]/d[o] */
    J[446] -= dqdci;              /* dwdot[hcco]/d[o] */
    /* d()/d[hcco] */
    dqdci =  + k_f*sc[11];
    J[668] += dqdci;              /* dwdot[ch]/d[hcco] */
    J[671] += dqdci;              /* dwdot[co2]/d[hcco] */
    J[674] -= dqdci;              /* dwdot[o]/d[hcco] */
