    /* d()/dT */
    J[1487] += dqdT;              /* dwdot[ch]/dT */
    J[1490] += dqdT;              /* dwdot[co2]/dT */
    J[1493] -= dqdT;              /* dwdot[o]/dT */
    J[1499] -= dqdT;              /* dwdot[hcco]/dT */

    /*reaction 225: hcco + o2 <=> hco + co + o */
    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[10]*sc[17];
    k_f = prefactor_units[224] * fwd_A[224]
                * exp(fwd_beta[224] * tc[0] - activation_units[224] * fwd_Ea[224] * invT);
    dlnkfdT = fwd_beta[224] * invT + activation_units[224] * fwd_Ea[224] * invT2;
    /* reverse */
    phi_r = sc[7]*sc[9]*sc[11];
    Kc = refC * exp(-g_RT[7] - g_RT[9] + g_RT[10] - g_RT[11] + g_RT[17]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[10] + h_RT[17]) + (h_RT[7] + h_RT[9] + h_RT[11]) - 1);
    dkrdT = (dlnkfdT - dlnKcdT)*k_r;
    /* rate of progress */
    q = k_f*phi_f - k_r*phi_r;
    dqdT = (dlnkfdT*k_f*phi_f - dkrdT*phi_r);
    /* update wdot */
    wdot[7] += q; /* hco */
    wdot[9] += q; /* co */
    wdot[10] -= q; /* o2 */
    wdot[11] += q; /* o */
    wdot[17] -= q; /* hcco */
    /* d()/d[hco] */
    dqdci =  - k_r*sc[9]*sc[11];
    J[280] += dqdci;              /* dwdot[hco]/d[hco] */
    J[282] += dqdci;              /* dwdot[co]/d[hco] */
    J[283] -= dqdci;              /* dwdot[o2]/d[hco] */
    J[284] += dqdci;              /* dwdot[o]/d[hco] */
    J[290] -= dqdci;              /* dwdot[hcco]/d[hco] */
    /* d()/d[co] */
    dqdci =  - k_r*sc[7]*sc[11];
    J[358] += dqdci;              /* dwdot[hco]/d[co] */
    J[360] += dqdci;              /* dwdot[co]/d[co] */
    J[361] -= dqdci;              /* dwdot[o2]/d[co] */
    J[362] += dqdci;              /* dwdot[o]/d[co] */
    J[368] -= dqdci;              /* dwdot[hcco]/d[co] */
    /* d()/d[o2] */
    dqdci =  + k_f*sc[17];
    J[397] += dqdci;              /* dwdot[hco]/d[o2] */
    J[399] += dqdci;              /* dwdot[co]/d[o2] */
    J[400] -= dqdci;              /* dwdot[o2]/d[o2] */
    J[401] += dqdci;              /* dwdot[o]/d[o2] */
    J[407] -= dqdci;              /* dwdot[hcco]/d[o2] */
    /* d()/d[o] */
    dqdci =  - k_r*sc[7]*sc[9];
    J[436] += dqdci;              /* dwdot[hco]/d[o] */
    J[438] += dqdci;              /* dwdot[co]/d[o] */
    J[439] -= dqdci;              /* dwdot[o2]/d[o] */
    J[440] += dqdci;              /* dwdot[o]/d[o] */
    J[446] -= dqdci;              /* dwdot[hcco]/d[o] */
    /* d()/d[hcco] */
    dqdci =  + k_f*sc[10];
    J[670] += dqdci;              /* dwdot[hco]/d[hcco] */
    J[672] += dqdci;              /* dwdot[co]/d[hcco] */
    J[673] -= dqdci;              /* dwdot[o2]/d[hcco] */
    J[674] += dqdci;              /* dwdot[o]/d[hcco] */
    J[680] -= dqdci;              /* dwdot[hcco]/d[hcco] */
    /* d()/dT */
    J[1489] += dqdT;              /* dwdot[hco]/dT */
    J[1491] += dqdT;              /* dwdot[co]/dT */
    J[1492] -= dqdT;              /* dwdot[o2]/dT */
    J[1493] += dqdT;              /* dwdot[o]/dT */
    J[1499] -= dqdT;              /* dwdot[hcco]/dT */

