    wdot[7] += q; /* hco */
    wdot[8] += q; /* co2 */
    wdot[10] -= q; /* o2 */
    wdot[17] -= q; /* hcco */
    /* d()/d[hco] */
    dqdci =  - k_r*sc[8];
    J[280] += dqdci;              /* dwdot[hco]/d[hco] */
    J[281] += dqdci;              /* dwdot[co2]/d[hco] */
    J[283] -= dqdci;              /* dwdot[o2]/d[hco] */
    J[290] -= dqdci;              /* dwdot[hcco]/d[hco] */
    /* d()/d[co2] */
    dqdci =  - k_r*sc[7];
    J[319] += dqdci;              /* dwdot[hco]/d[co2] */
    J[320] += dqdci;              /* dwdot[co2]/d[co2] */
    J[322] -= dqdci;              /* dwdot[o2]/d[co2] */
    J[329] -= dqdci;              /* dwdot[hcco]/d[co2] */
